import React from "react";
import { useSelector } from "react-redux";
import { Link } from "react-router-dom";
import ChangeLanguage from "../ChangeLanguage/ChangeLanguage";
import './NavBar.css'
export default function NavBar() {
  //favorite movies
  const favorite_movies = useSelector((state)=> state.favorites.favorites)
  console.log(favorite_movies)
  const num_fav_movies = favorite_movies.length
  console.log(num_fav_movies)
  return ( 
    <ul className="nav bg-dark">
      <li className="nav-item">
        <Link className="nav-link " aria-current="page" to="/movies">
          Movies
        </Link>
      </li>
      <li className="nav-item">
        <Link className="nav-link" to="/favorites">
          Favorites{num_fav_movies}
        </Link>
      </li>
      <li className="nav-item">
        <Link className="nav-link" to="/login">
          Login
        </Link>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="#">
          Register
        </a>
      </li>
      <ChangeLanguage />
    </ul>
  );
}
